import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import CocktailsApp from './CocktailsApp';
import AllCocktailsPage from './AllCocktailsPage';
import Navbar from './Navbar';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Route path="/" exact component={HomePage} /> {/* Route pour la page d'accueil */}
        <Route path="/all-cocktails" component={AllCocktailsPage} />
        <Route path="/cocktails-app" component={CocktailsApp} />
      </div>
    </Router>
  );
}

export default App;
